def stemming(tokens):
    stemmer = PorterStemmer()

    return [stemmer.stem(t) for t in tokens]

fn_9.code:
def query_score(q,d):
    qset = set(tokenize(q))
    dset = set(tokenize(d))

    return len(qset.intersection(dset))

