def ranking(scores,top_k=5):
    docs = load_docs(DOCS_PATH)
    doc_map = {str(doc["id"]) : doc["url"] for doc in docs}

    return [(doc_id,doc_map.get(doc_id,""),score) for doc_id,score in scores.most_common(top_k)]

